package com.xuyuan.test.java;import java.util.Date;public class DoubleLoop {	public static void main(String[] args) {		int[] a = new int[6];		for(int i=0;i<6;i++){			a[i] = i;		}		int[] b = new int[5];		b[0] = 1;		b[1] = 2;		b[2] = 5;		b[3] = 6;		b[4] = 7;		for(int i=0;i<a.length;i++){			for(int j=0;j<b.length;j++){				if(a[i] == b[j]){					System.out.println(a[i]);					break;				}			}		}	}}